import React from 'react'
import {HeroBg,ImageBg,HeroContainer} from './HeroElements';
import image from '../../images/hero.jpg';

const HeroSection = () => {
    return (
        <HeroContainer>
            <HeroBg>
                <ImageBg src={image}>

                </ImageBg>
            </HeroBg>

        </HeroContainer>
    )
}

export default HeroSection;
